import './Notifications.css'

export default function Notifications() {
    return (
        <>
            <button
              style={{ color: "#3a3a3a", fontWeight: "bold", background: "none", border: "none", fontSize: "15px", posistion: "absolute", right: "2px", top: "2px", cursor: "pointer" }}
              aria-label="Close"
              >
            </button>
            <div className="Notifications">
                <p>Here is the list of notifications</p>
            </div>
        </>
    )
}
